import { Container, Link } from "@mui/material";
import { useNavigate } from "react-router";

export default function HomePage(){
  navigate = useNavigate()
  return(
    <>
    <Container>
      <Link onClick>Home</Link>
      <Link>/Crypto</Link>
    </Container>
    </>
  )
}
